import React, { useState, useEffect } from 'react';
import {
  Card,
  CardContent,
  Button,
  TextField,
  LinearProgress,
  Alert,
  Box,
  Typography,
  Chip,
} from '@mui/material';
import {
  CheckCircle as CheckCircleIcon,
  Cancel as CancelIcon,
} from '@mui/icons-material';

interface VocabularyItem {
  id: string;
  word: string;
  meaning: string;
  example?: string;
  translation?: string;
  round?: number;
  isKnown?: boolean;
}

interface EvaluationResult {
  wordId: string;
  isCorrect: boolean;
  userAnswer: string;
}

interface VocabularyEvaluationProps {
  vocabularyData: VocabularyItem[];
  onComplete: (results: EvaluationResult[], attemptNumber: number) => void;
  attemptNumber: number;
  studentId: string;
}

const VocabularyEvaluation: React.FC<VocabularyEvaluationProps> = ({
  vocabularyData,
  onComplete,
  attemptNumber,
  studentId
}) => {
  const [currentIndex, setCurrentIndex] = useState(0);
  const [userInput, setUserInput] = useState('');
  const [results, setResults] = useState<EvaluationResult[]>([]);
  const [showFeedback, setShowFeedback] = useState(false);
  const [isCorrect, setIsCorrect] = useState<boolean | null>(null);
  const [suggestions, setSuggestions] = useState<string[]>([]);
  const [correctAnswer, setCorrectAnswer] = useState<string>('');  // 정답 저장
  const [evaluationWords, setEvaluationWords] = useState<VocabularyItem[]>([]);

  // 평가 대상 단어 필터링 (1라운드에서 "알겠어요"를 선택한 단어 제외)
  useEffect(() => {
    console.log('VocabularyEvaluation: vocabularyData received:', vocabularyData);
    
    // 데이터 구조 자세히 로그
    vocabularyData.forEach((item, index) => {
      console.log(`Word ${index}:`, {
        id: item.id,
        word: item.word,
        meaning: item.meaning,
        round: item.round,
        isKnown: item.isKnown
      });
    });
    
    const wordsToEvaluate = vocabularyData.filter(
      item => !(item.round === 1 && item.isKnown === true)
    );
    console.log('VocabularyEvaluation: wordsToEvaluate:', wordsToEvaluate);
    setEvaluationWords(wordsToEvaluate);
  }, [vocabularyData]);

  const currentWord = evaluationWords[currentIndex];
  const progress = evaluationWords.length > 0 
    ? ((currentIndex + 1) / evaluationWords.length) * 100 
    : 0;

  // 뜻에서 주요 부분의 첫 글자 추출하는 함수 (단순화)
  const extractKeyLetter = (meaning: string): string => {
    if (!meaning) {
      console.error('extractKeyLetter: meaning is undefined');
      return '';
    }
    
    console.log('extractKeyLetter - original meaning:', meaning);
    
    // 괄호 제거
    let cleanMeaning = meaning.replace(/\([^)]*\)/g, '').trim();
    console.log('extractKeyLetter - after removing brackets:', cleanMeaning);
    
    // 조사 및 패턴 제거
    const patterns = [
      /^.*라고\s+/,  // "~라고 생각한다" -> "생각한다"
      /^.*에게\s+/,  // "A에게 B를" -> "B를"
      /^.*를\s+/,   // "B를 제공하다" -> "제공하다"
      /^.*을\s+/,
    ];
    
    patterns.forEach(pattern => {
      cleanMeaning = cleanMeaning.replace(pattern, '');
    });
    
    console.log('extractKeyLetter - after removing patterns:', cleanMeaning);
    
    // 공백으로 분리하여 첫 번째 의미있는 단어 찾기
    const words = cleanMeaning.split(/\s+/).filter(word => word.length > 0);
    console.log('extractKeyLetter - words array:', words);
    
    if (words.length === 0) {
      return meaning.charAt(0); // fallback
    }
    
    // 첫 번째 단어의 첫 글자 반환
    const result = words[0].charAt(0);
    console.log('extractKeyLetter - final result:', result);
    
    return result;
  };

  // 자동완성 제안 생성 (단순화)
  const generateSuggestions = (input: string) => {
    console.log('generateSuggestions called with input:', input);
    console.log('currentWord:', currentWord);
    
    if (!currentWord || !input || input.length !== 1) {
      console.log('Early return - no currentWord or input');
      return;
    }
    
    if (!currentWord.meaning) {
      console.error('generateSuggestions: currentWord.meaning is undefined', currentWord);
      return;
    }

    const keyLetter = extractKeyLetter(currentWord.meaning);
    console.log('Checking if input matches keyLetter:', `'${input}'`, '===', `'${keyLetter}'`);
    
    // 첫 글자가 정확히 맞으면 전체 뜻을 자동완성
    if (input === keyLetter) {
      console.log('MATCH! Auto-completing with full meaning:', currentWord.meaning);
      setUserInput(currentWord.meaning);
    } else {
      console.log('No match. Input:', `'${input}'`, 'Expected:', `'${keyLetter}'`);
    }
  };

  // 입력 변경 처리
  const handleInputChange = (value: string) => {
    console.log('handleInputChange called with value:', value, 'length:', value.length);
    setUserInput(value);
    
    // 입력값이 1글자일 때만 자동완성 시도
    if (value.length === 1) {
      generateSuggestions(value);
    }
  };

  // 답변 처리
  const handleAnswer = (correct: boolean, answer: string) => {
    setIsCorrect(correct);
    setShowFeedback(true);
    
    const result: EvaluationResult = {
      wordId: currentWord.id,
      isCorrect: correct,
      userAnswer: answer
    };
    
    const newResults = [...results, result];
    setResults(newResults);
    
    // 바로 다음 문제로 이동 (피드백 없이)
    if (currentIndex < evaluationWords.length - 1) {
      setCurrentIndex(currentIndex + 1);
      setUserInput('');
      setShowFeedback(false);
      setIsCorrect(null);
      setSuggestions([]);
      setCorrectAnswer('');
    } else {
      // 평가 완료 - 결과 표시
      onComplete(newResults, attemptNumber);
    }
  };

  // 입력 버튼 처리 (단순화)
  const handleSubmit = () => {
    console.log('handleSubmit called with userInput:', userInput);
    
    if (!currentWord || !currentWord.meaning) {
      console.error('handleSubmit: currentWord or meaning is undefined');
      return;
    }
    
    // 빈칸인 경우 오답 처리
    if (userInput.trim() === '') {
      console.log('Empty input, marking as incorrect');
      handleAnswer(false, userInput);
      return;
    }
    
    // 입력값이 정답(전체 뜻)과 정확히 일치하는지 확인
    const isCorrect = userInput.trim() === currentWord.meaning;
    
    console.log('Simple answer check:');
    console.log('  Expected:', currentWord.meaning);
    console.log('  User input:', userInput.trim());
    console.log('  Is correct:', isCorrect);
    
    handleAnswer(isCorrect, userInput);
  };

  const handleKeyPress = (e: React.KeyboardEvent<HTMLInputElement>) => {
    if (e.key === 'Enter') {
      handleSubmit();
    }
  };

  if (evaluationWords.length === 0) {
    return (
      <Alert severity="info" sx={{ maxWidth: 600, mx: 'auto', mt: 3 }}>
        평가할 단어가 없습니다. 먼저 학습을 완료해주세요.
      </Alert>
    );
  }

  if (!currentWord) {
    return null;
  }

  return (
    <Card sx={{ maxWidth: 800, mx: 'auto', mt: 3 }}>
      <CardContent>
        <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
          <Typography variant="h5">{attemptNumber}차 평가</Typography>
          <Typography variant="body2" color="text.secondary">
            {currentIndex + 1} / {evaluationWords.length}
          </Typography>
        </Box>
        <LinearProgress variant="determinate" value={progress} sx={{ mb: 3 }} />
        {/* 현재 단어 표시 */}
        <Box sx={{ textAlign: 'center', mb: 4 }}>
          <Typography variant="h3" sx={{ fontWeight: 'bold', mb: 2 }}>
            {currentWord.word}
          </Typography>
          {currentWord.example && (
            <Typography variant="body1" sx={{ fontStyle: 'italic', color: 'text.secondary', mb: 2 }}>
              "{currentWord.example}"
            </Typography>
          )}
          {/* 디버깅을 위해 정답 표시 */}
          <Typography variant="body2" sx={{ color: 'primary.main', mb: 1 }}>
            정답: {currentWord?.meaning || '정답 없음'}
          </Typography>
          <Typography variant="body2" sx={{ color: 'secondary.main' }}>
            첫 글자: {currentWord?.meaning ? extractKeyLetter(currentWord.meaning) : '없음'}
          </Typography>
        </Box>

        {/* 입력 필드 */}
        <Box sx={{ mb: 3 }}>
          <Typography variant="body2" color="text.secondary" sx={{ mb: 1 }}>
            뜻의 첫 글자를 입력하세요
          </Typography>
          <Box sx={{ position: 'relative' }}>
            <TextField
              fullWidth
              value={userInput}
              onChange={(e) => handleInputChange(e.target.value)}
              onKeyPress={handleKeyPress}
              placeholder="첫 글자 입력..."
              disabled={showFeedback}
              autoFocus
              variant="outlined"
            />
          </Box>
                      <Button
            variant="contained"
            onClick={handleSubmit}
            sx={{ mt: 2 }}
            fullWidth
          >
            입력
          </Button>
        </Box>

        {/* 피드백 표시 제거 - 평가 끝에 결과만 표시 */}

        {/* 진행 상태 */}
        <Box sx={{ display: 'flex', justifyContent: 'center', gap: 0.5 }}>
          {evaluationWords.map((_, index) => (
            <Box
              key={index}
              sx={{
                width: 8,
                height: 8,
                borderRadius: '50%',
                bgcolor: index < currentIndex
                  ? results[index]?.isCorrect
                    ? 'success.main'
                    : 'error.main'
                  : index === currentIndex
                  ? 'primary.main'
                  : 'grey.300'
              }}
            />
          ))}
        </Box>
      </CardContent>
    </Card>
  );
};

